import { 
    Flex,
    Heading
} from '@chakra-ui/react';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const Logo = () => {
    return (
        <Flex>
            <Heading 
                as="h1" 
                color="#ff8177"
                // bgImage="linear-gradient(to top, #ff0844 0%, #ffb199 100%)"
                // bgSize="100%"
            >
                BreakDown
            </Heading>
        </Flex>
    );
}

export default Logo;
